const markalar_style = () => {
  const style = `
  <style>
      .anatomi_onemli_markalar_container {
        width: 100%;
        height: fit-content;
      }

      .anatomi_onemli_markalar_content {
        width: 100%;
        height: fit-content;
        display: flex;
        flex-direction: column;
        justify-content: flex-start;
        align-items: flex-start;
      }

      .anatomi_onemli_markalar_title h2 {
        font-size: 14px;
        font-weight: 700;
        color: #000;
        margin-bottom: 10px;
      }

      .anatomi_onemli_markalar_list {
        width: 100%;
        height: fit-content;
        display: flex;
        justify-content: flex-start;
        align-items: center;
        gap: 10px;
      }

      .anatomi_onemli_markalar_item {
        position: relative;
        width: 120px;
        height: 100px;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        border-radius: 5px;
        overflow: hidden;
        border: 2px solid #ffc20e;
      }

      .anatomi_onemli_markalar_button {
        position: absolute;
        bottom: 0;
        width: 100%;
        height: 30px;
        background-color: #ffc20e;
        display: flex;
        justify-content: center;
        align-items: center;
        color: #fff;
        text-decoration: none;
        font-size: 12px;
        font-weight: 500;
      }

      .anatomi_onemli_markalar_img {
        width: 100%;
        height: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        margin-bottom: 20px;
      }

      .anatomi_onemli_markalar_img svg {
        width: 80%;
        height: 100%;
      }
    </style>
  `;

    const head = document.querySelector("head");
    head.insertAdjacentHTML("beforeend", style);
}

const init = () => {
    markalar_html();
    markalar_style();
};

if(window.innerWidth < 768){
    init();
}
